import "./components/style-index.css"


function App() {
  return (
    <div>
      <div className="main-header sticky">
        <a className="logo-box logo-box--index" href="index.html">
          M<div id="logo-a">ore</div>M<div id="logo-b">ore</div>M
          <div id="logo-c">e</div>
        </a>
      </div>
      <div className="button-area">
          <Button className="main-header-buttons" id="login-button"><strong>LOGIN</strong></Button>
          <Button className="main-header-buttons" id="sign-up-button"><strong>SIGN UP</strong></Button>
        <a  className="about-button">...about</a>
      </div>
    </div>
  );
}

export default App;
